  const defaultUrl = 'http://10.0.2.2:8081';
  const bundleURL = (process.env.EXPO_BUNDLE_URL || defaultUrl).trim();
  const devClientURL = `exp+seguridadciudadanaapp://expo-development-client/?url=${encodeURIComponent(bundleURL)}`;
